import React, { Suspense, lazy } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { ThemeProvider } from './context/ThemeContext';
import Navbar from './components/Navbar';

// Lazy-loaded components
const HomePage = lazy(() => import('./pages/HomePage'));
const DatabasePage = lazy(() => import('./pages/DatabasePage'));
const IndividualsPage = lazy(() => import('./pages/IndividualsPage'));
const UploadPage = lazy(() => import('./pages/UploadPage'));

// Loading component
const LoadingFallback = () => (
  <div className="flex justify-center items-center h-screen">
    <div className="animate-pulse flex flex-col items-center">
      <div className="rounded-full bg-blue-100 dark:bg-blue-900 p-4">
        <svg className="h-12 w-12 text-blue-600 dark:text-blue-300 animate-spin" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24">
          <circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4"></circle>
          <path className="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8V0C5.373 0 0 5.373 0 12h4zm2 5.291A7.962 7.962 0 014 12H0c0 3.042 1.135 5.824 3 7.938l3-2.647z"></path>
        </svg>
      </div>
      <p className="mt-4 text-lg font-medium text-gray-700 dark:text-gray-300">Loading...</p>
    </div>
  </div>
);

// Simple page wrapper with a fade-in effect
const PageWrapper = ({ children }) => {
  return (
    <div className="fade-in">
      {children}
    </div>
  );
};

function App() {
  return (
    <ThemeProvider>
      <Router>
        <div className="min-h-screen bg-gray-50 dark:bg-gray-900 transition-colors duration-200 flex flex-col">
          <Navbar />
          <main className="flex-grow">
            <Suspense fallback={<LoadingFallback />}>
              <Routes>
                <Route path="/" element={
                  <PageWrapper>
                    <HomePage />
                  </PageWrapper>
                } />
                <Route path="/upload" element={
                  <PageWrapper>
                    <UploadPage />
                  </PageWrapper>
                } />
                <Route path="/database" element={
                  <PageWrapper>
                    <DatabasePage />
                  </PageWrapper>
                } />
                <Route path="/individuals" element={
                  <PageWrapper>
                    <IndividualsPage />
                  </PageWrapper>
                } />
              </Routes>
            </Suspense>
          </main>
          <footer className="py-6 px-4 mt-10 border-t border-gray-200 dark:border-gray-800">
            <div className="max-w-7xl mx-auto flex flex-col sm:flex-row justify-between items-center">
              <p className="text-gray-500 dark:text-gray-400 text-sm mb-2 sm:mb-0">
                Paystub Manager &copy; {new Date().getFullYear()}
              </p>
              <div className="flex space-x-4">
                <a href="#" className="text-gray-500 hover:text-gray-700 dark:text-gray-400 dark:hover:text-gray-300 text-sm">Privacy Policy</a>
                <a href="#" className="text-gray-500 hover:text-gray-700 dark:text-gray-400 dark:hover:text-gray-300 text-sm">Terms of Service</a>
                <a href="#" className="text-gray-500 hover:text-gray-700 dark:text-gray-400 dark:hover:text-gray-300 text-sm">Support</a>
              </div>
            </div>
          </footer>
        </div>
      </Router>
    </ThemeProvider>
  );
}

export default App;
